  static List<HymnsContent> list = [
    HymnsContent(id: 3654, position: 1, content: "Mweswe mukwa kwivwa, ambulula, \nMukuvwisa eswe Sango Lipema; \nKu yifuchi anji kanda alivwa, \nWeswe wa kuta, eze.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3655, content: "Mweswe wa kuta, mweswe wa kuta, \nTutwalenu liji lia kulakenya, \nZambi Tata yetu kanazange eswe, \nMweswe wa kuta, eze.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_14, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3656, position: 2, content: "Mweswe mukwa kwiza  \nKanda ashimbula, \nPito lichili liawashi, anjile; \nMumu Yesu Jila ya mwono Iye, \nMweswe wa kuta, eze.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_14, typeStanza: HymnsContentCode.VERSE),
