    HymnsContent(id: 3658, position: 1, content: "Ezenu kuli Chilamwina. \nLiji lienyi liatulumbunwina; \nMukachi hetu kakumana, \nNikutulakenya.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_15, typeStanza: HymnsContentCode.VERSE),
