    HymnsContent(id: 3660, position: 2, content: "Ezenu ana, kana nwambe, \nEzenu hanga numukaule; \nMutongolenu apwe Mwene, \nKanda nulaluka.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3661, position: 3, content: "Nyongenu nawa, kwali kuno, \nOnonokenu ku yiyulo; \nIvwa kuhiohia liji lino, \nItenu, anami.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_15, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3662, position: 1, content: "Ola ya kulemba te, mubunge \njifukame, \nKuli Yesu mwe  \nMwene tukunguluke; \nKachi mutufuliela,  \nKachi matufunga; \nOla ya kuhwimisa!  \nKupwako chipema!", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3663, content: "Ola yiwape! Ola yiwape! \nOla ya kuhwimisa;  \nKupwako chipema!", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_16, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3664, position: 2, content: "Ola ya kulemba te,  \nChilamwina meza, \nNi kutuvwila keke matupanjika; \nYe yipikalo yeswe  \nKuli Iye kwecha; \nOla ya kuhwimisa!  \nKupwako chipema!", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_16, typeStanza: HymnsContentCode.VERSE),
