    HymnsContent(id: 3666, position: 4, content: "Ola ya kulemba te, \nNikumufuliela, \nTwakutambula yize \ntwakuyihona; \nNikujamina pundu,  \nChocho mutuhwima; \nOla ya kuhwimisa!  \nKupwako chipema!", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_16, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3667, position: 1, content: "Kungunevu liji lienyi, \nKungunevu liji lienyi, \nKungunevu liji lienyi, \nUngukaule kweswe mu jila.", hymnsNumber: CoHymnsNumberSeeder.KU_LAKENHA_17, typeStanza: HymnsContentCode.VERSE),
